import React from "react"

import Carousel from "../components/Parallax"
import data from "../data"

function Carousels() {
    console.log(data)
    return(
        <div>
            {data.map(item => {
                return (<Carousel key={item.id} object={item}/>)
            })}
            {/* <Carousel object={data[2]}/> */}
        </div>
    )
}

export default Carousels
